import React, { useState } from 'react';
import axios from 'axios';
import '../static/css/appStyle.css';

import StateSelecter from '../components/StateSelecter';
import FormInputString from '../components/Form/FormInputString';

import { 
    Title, 
    RegisterForm, 
    RowSection, 
    SectionTitle, 
    RedAsterisk, 
    RegisterInput, 
    CustomSelecter 
} from '../static/StyledComponents';

const App = props => {
    const [state, setState] = useState();
    const [cities, setCities] = useState();

    return (
        <div>
            <Title>
                Cadastro de Empres√°rios
            </Title>
            <RegisterForm>
                <FormInputString title="Nome" />
                <FormInputString title="Celular" />
                <RowSection>
                    <SectionTitle>Estado</SectionTitle>
                    <RedAsterisk>*</RedAsterisk>
                </RowSection>
                <StateSelecter setSelectedState={setState} setCities={setCities} />
                <RowSection>
                    <SectionTitle>Cidade</SectionTitle>
                    <RedAsterisk>*</RedAsterisk>
                </RowSection>
                <CustomSelecter>
                    {cities && cities.map((element, key) => {
                        return <option value={element.nome} key={element.id}>{element.nome}</option>
                    })}
                </CustomSelecter>
                <SectionTitle>Pai empresarial</SectionTitle>
                <CustomSelecter>
                    <option>test</option>
                </CustomSelecter>
            </RegisterForm>
        </div>
    );
};

export default App;
